var $bm_rt;
var calibrate, on_off, d, s, L, center, center, myTime, angle, angle;
calibrate = div(effect('Posici\xf3n - Orbit Calibrate')('ADBE Slider Control-0001'), 57);
on_off = effect('Posici\xf3n - Orbit Direction')('ADBE Checkbox Control-0001');
d = mul(effect('Posici\xf3n - Orbit Distance')('ADBE Slider Control-0001'), 15);
s = div(effect('Posici\xf3n - Orbit Speed')('ADBE Slider Control-0001'), 10);
try {
    L = effect('Posici\xf3n - Orbit Target')('ADBE Layer Control-0001');
    center = L.toWorld(L.anchorPoint);
} catch (err) {
    center = value;
}
myTime = Math.max(0, sub(time, inPoint));
if (on_off == 1) {
    angle = sum(mul(mul(mul(s, myTime), 2), Math.PI), calibrate);
} else {
    angle = mul(sum(mul(mul(mul(s, myTime), 2), Math.PI), calibrate), -1);
}
$bm_rt = value = sum(center, mul([
    Math.sin(angle) / thisComp.pixelAspect,
    -Math.cos(angle)
], d));

